import React from 'react'
import { expect, enzyme, shallow } from '../lib/test-setup'
import User from './User.jsx'

// console.log(shallow)
const fakeUser = {
  firstName: 'Fake',
  lastName: 'User',
  email: 'fake.user@example.com'
}

